const WillStorage = require('./../ethereum/build/contracts/WillStorage.json');

export const wills = async () => {
	return await new window.web3.eth.Contract(WillStorage['abi'], '0x5037e1a5e02e081b1b850b130eca7ac17335fdf4c61cc5ff6ae765196fb0d5b3');
};
